import React, { Component } from "react";

class App extends Component {
  render() {
    return (
      <div>
        <h1>Hello</h1>
        <p>My name is Shrey, Im a Software Engineer</p>
        <p> Im looking forward to working on cool project</p>
      </div>
    );
  }
}

export default App;
